// GET /pedidos
[
  {
    "id": 1,
    "clienteNombre": "Nombre Cliente",
    "fecha": "2023-05-20T14:30:00",
    "estado": "pendiente",
    "total": 25.99,
    "productos": [
      {
        "productoId": 1,
        "nombre": "Producto 1",
        "cantidad": 2,
        "precioUnitario": 5.99,
        "ingredientesAdicionales": [1, 3] // IDs de ingredientes
      }
    ]
  }
]

